import React from "react"
import styles from "./Checkout.module.css"

export const Checkout = (props) => {
  let locationHook=props.myHookValue
  let exchange = new URLSearchParams(locationHook.search).get('exchange');
  let offer = new URLSearchParams(locationHook.search).get('offer');
  let samsungCare = new URLSearchParams(locationHook.search).get('careplus');
  let configs = [];
  if(exchange!=undefined){
    alert(exchange)
    configs.push(exchange)
  }if(offer!=undefined){
    configs.push(offer)
  }if(samsungCare!=undefined){
    configs.push(samsungCare)
  }

  return(
    <React.Fragment>
    <div className={styles.container}>

    <img className={styles.deviceImg} src={new URLSearchParams(locationHook.search).get('image')}/>
    <div className={styles.deviceConfig}>
    <ul>
    {configs.map(element => <li> {element.name} {element.price} </li>)}
    </ul>
    </div>

    </div>
    </React.Fragment>
    )
}
